"Form coulomb repulsion integral using Rys quadrature"
@njit(cache=True,fastmath=True, error_model='numpy', nogil=True)#, locals=dict(ijkl=np.float32, Ix=np.float32, Iy=np.float32, Iz=np.float32, val=np.float32)
def coulomb_rys(roots,weights,G,rpq2, rho, norder,n,m,la,lb,lc,ld,ma,mb,mc,md,na,nb,nc,nd,alphaik, alphajk, alphakk, alphalk,I,J,K,L):
    X = rpq2*rho

    # roots = np.zeros((norder))
    # weights = np.zeros((norder))
    # G = np.zeros((n+1,m+1))

    roots, weights = Roots(norder,X,roots,weights)
    A = alphaik+alphajk 
    B = alphakk+alphalk 
    Ap = alphaik*alphajk
    Bp = alphakk*alphalk
    ABsrt = np.sqrt(A*B)

    ijkl = 0.0
    for i in range(norder):
        G = Recur(G,roots[i],la,lb,lc,ld,I[0],J[0],K[0],L[0],alphaik,alphajk,alphakk,alphalk,A,B,Ap,Bp,ABsrt)
        
        Ix = Int1d(G,roots[i],la,lb,lc,ld,I[0],J[0],K[0],L[0],
                 alphaik,alphajk,alphakk,alphalk)
        
        G = Recur(G,roots[i],ma,mb,mc,md,I[1],J[1],K[1],L[1],alphaik,alphajk,alphakk,alphalk,A,B,Ap,Bp,ABsrt)
        Iy = Int1d(G,roots[i],ma,mb,mc,md,I[1],J[1],K[1],L[1],
                 alphaik,alphajk,alphakk,alphalk)
        
        G = Recur(G,roots[i],na,nb,nc,nd,I[2],J[2],K[2],L[2],alphaik,alphajk,alphakk,alphalk,A,B,Ap,Bp,ABsrt)
        
        Iz = Int1d(G,roots[i],na,nb,nc,nd,I[2],J[2],K[2],L[2],
                 alphaik,alphajk,alphakk,alphalk)
        ijkl += Ix*Iy*Iz*weights[i] # ABD eq 5 & 9
        
        
        
    val = 2*np.sqrt(rho/np.pi)*ijkl # ABD eq 5 & 9
    
    
    return  val

"Form coulomb repulsion integral using Rys quadrature"
@njit(cache=True, fastmath=True, error_model='numpy', nogil=True)#, locals=dict(ijkl=np.float32, Ix=np.float32, Iy=np.float32, Iz=np.float32, val=np.float32)
def coulomb_rys_3c2e(roots,weights,G,rpq2, rho, norder,n,m,la,lb,lc,ld,ma,mb,mc,md,na,nb,nc,nd,alphaik, alphajk, alphakk, alphalk,I,J,K,L,P):
    X = rpq2*rho
    roots, weights = Roots(norder,X,roots,weights)
    A = alphaik+alphajk 
    B = alphakk#+alphalk 
    Ap = alphaik*alphajk
    ABsrt = np.sqrt(A*B)
    # value = np.pi*np.exp(-Ap*(I-J)**2/A )/ABsrt
    IJ = I-J
    # KL = K

    ijkl = 0.0
    tot_ang = la+ma+na+lb+mb+nb+lc+mc+nc+ld+md+nd
    pi = 3.141592653589793

    
    for i in range(norder):
        if tot_ang==0:
            Gx = Ap/A*(IJ[0]**2)
            G00 = np.pi / ABsrt
            Ix = np.exp(-Gx)*G00
            Gy = Ap/A*(IJ[1]**2)
            Iy = np.exp(-Gy)*G00
            Gz = Ap/A*(IJ[2]**2)
            Iz = np.exp(-Gz)*G00
            ijkl += (Ix*Iy*Iz)*weights[0]
        elif ((tot_ang==1) and (la+ma+na==1)): #(ps|s) # Doesn't seem give any speeed advantage whatsoever
            ooopt = 1/(1+roots[0])
            G[0,0] = pi*np.exp(-Ap*(IJ[0])**2/A)/ABsrt
            if la==1:
                C = (P[0]-I[0])*ooopt + (B*(K[0]-I[0])+A*(P[0]-I[0]))*roots[0]*ooopt/(A+B)
                G[1,0] = C*G[0,0]
                Ix = G[1,0]
            else:
                Ix = G[0,0]
            G[0,0] = pi*np.exp(-Ap*(IJ[1])**2/A)/ABsrt
            if ma==1:
                C = (P[1]-I[1])*ooopt + (B*(K[1]-I[1])+A*(P[1]-I[1]))*roots[0]*ooopt/(A+B)
                G[1,0] = C*G[0,0]
                Iy = G[1,0]
            else:
                Iy = G[0,0]
            G[0,0] = pi*np.exp(-Ap*(IJ[2])**2/A)/ABsrt
            if na==1:
                C = (P[2]-I[2])*ooopt + (B*(K[2]-I[2])+A*(P[2]-I[2]))*roots[0]*ooopt/(A+B)
                G[1,0] = C*G[0,0]
                Iz = G[1,0]
            else:
                Iz = G[0,0]
            ijkl += (Ix*Iy*Iz)*weights[0]
        else:
            G = Recur_3c2e(G,roots[i],la,lb,lc,ld,I[0],J[0],K[0],L[0],alphaik,alphajk,alphakk,alphalk,A,B,Ap,ABsrt)
            # Ix = Int1d(G,roots[i],la,lb,lc,ld,I[0],J[0],K[0],L[0],
            #          alphaik,alphajk,alphakk,alphalk)
            Ix = Shift_3c2e(G,la,lb,lc,ld,IJ[0])
            # print('reached here5')
            G = Recur_3c2e(G,roots[i],ma,mb,mc,md,I[1],J[1],K[1],L[1],alphaik,alphajk,alphakk,alphalk,A,B,Ap,ABsrt)
            # print(G)
            # print('reached here6')
            # Iy = Int1d(G,roots[i],ma,mb,mc,md,I[1],J[1],K[1],L[1],
            #          alphaik,alphajk,alphakk,alphalk)
            Iy = Shift_3c2e(G,ma,mb,mc,md,IJ[1])
            # print('reached here7')
            G = Recur_3c2e(G,roots[i],na,nb,nc,nd,I[2],J[2],K[2],L[2],alphaik,alphajk,alphakk,alphalk,A,B,Ap,ABsrt)
            # Iz = Int1d(G,roots[i],na,nb,nc,nd,I[2],J[2],K[2],L[2],
            #          alphaik,alphajk,alphakk,alphalk)
            Iz = Shift_3c2e(G,na,nb,nc,nd,IJ[2])
            ijkl += Ix*Iy*Iz*weights[i] # ABD eq 5 & 9
        
        
    val = 2*np.sqrt(rho/pi)*ijkl # ABD eq 5 & 9
    
    return  val

@njit(cache=True,fastmath=True, error_model='numpy', nogil=True)#, locals=dict(ijkl=np.float32, Ix=np.float32, Iy=np.float32, Iz=np.float32, val=np.float32)
def coulomb_rys_new(roots,weights,G,rpq2, rho, norder,n,m,la,lb,lc,ld,ma,mb,mc,md,na,nb,nc,nd,alphaik, alphajk, alphakk, alphalk,I,J,K,L):
    X = rpq2*rho
    # print('s')
    # roots = np.zeros((norder))
    # weights = np.zeros((norder))
    # G = np.zeros((n+1,m+1))

    roots, weights = Roots(norder,X,roots,weights)
    A = alphaik+alphajk 
    B = alphakk+alphalk 
    Ap = alphaik*alphajk
    Bp = alphakk*alphalk
    ABsrt = np.sqrt(A*B)

    value = np.pi*np.exp(-Ap*(I-J)**2/A - Bp*(K-L)**2/B)/ABsrt
    P = (alphaik*I+alphajk*J)/A
    Q = (alphakk*K+alphalk*L)/B
    IJ = I-J
    KL = K-L


    ijkl = 0.0
    for i in range(norder):
        G = Recur_new(G,roots[i],la,lb,lc,ld,I[0],J[0],K[0],L[0],A,B,value[0],P[0],Q[0])
        # Ix = Int1d(G,roots[i],la,lb,lc,ld,I[0],J[0],K[0],L[0],
        #          alphaik,alphajk,alphakk,alphalk)
        Ix = Shift(G,la,lb,lc,ld,IJ[0],KL[0])
        
        G = Recur_new(G,roots[i],ma,mb,mc,md,I[1],J[1],K[1],L[1],A,B,value[1],P[1],Q[1])
        # Iy = Int1d(G,roots[i],ma,mb,mc,md,I[1],J[1],K[1],L[1],
        #          alphaik,alphajk,alphakk,alphalk)
        Iy = Shift(G,ma,mb,mc,md,IJ[1],KL[1])
        
        G = Recur_new(G,roots[i],na,nb,nc,nd,I[2],J[2],K[2],L[2],A,B,value[2],P[2],Q[2])
        # Iz = Int1d(G,roots[i],na,nb,nc,nd,I[2],J[2],K[2],L[2],
        #          alphaik,alphajk,alphakk,alphalk)
        Iz = Shift(G,na,nb,nc,nd,IJ[2],KL[2])

        ijkl += Ix*Iy*Iz*weights[i] # ABD eq 5 & 9
        
        
        
    val = 2*np.sqrt(rho/np.pi)*ijkl # ABD eq 5 & 9
    
    
    return  val

"Should be Faster but isn't"
@njit(cache=True,fastmath=True, error_model='numpy', nogil=True)#, locals=dict(ijkl=np.float32, Ix=np.float32, Iy=np.float32, Iz=np.float32, val=np.float32)
def coulomb_rys_fast(roots,weights,G,norder,la,lb,lc,ld,ma,mb,mc,md,na,nb,nc,nd,alphaik, alphajk, alphakk, alphalk,I,J,K,L,X,A,B,Ap,Bp,ABsrt,factor,P,Q):
    
    roots, weights = Roots(norder,X,roots,weights)

    ijkl = 0.0
    for i in range(norder):
        G = Recur_fast(G,roots[i],la,lb,lc,ld,I[0],J[0],K[0],L[0],alphaik,alphajk,alphakk,alphalk,A,B,Ap,Bp,ABsrt,P[0],Q[0])
        
        Ix = Int1d(G,roots[i],la,lb,lc,ld,I[0],J[0],K[0],L[0],
                 alphaik,alphajk,alphakk,alphalk)
        
        G = Recur_fast(G,roots[i],ma,mb,mc,md,I[1],J[1],K[1],L[1],alphaik,alphajk,alphakk,alphalk,A,B,Ap,Bp,ABsrt,P[1],Q[1])
        Iy = Int1d(G,roots[i],ma,mb,mc,md,I[1],J[1],K[1],L[1],
                 alphaik,alphajk,alphakk,alphalk)
        
        G = Recur_fast(G,roots[i],na,nb,nc,nd,I[2],J[2],K[2],L[2],alphaik,alphajk,alphakk,alphalk,A,B,Ap,Bp,ABsrt,P[2],Q[2])
        
        Iz = Int1d(G,roots[i],na,nb,nc,nd,I[2],J[2],K[2],L[2],
                 alphaik,alphajk,alphakk,alphalk)
        ijkl += Ix*Iy*Iz*weights[i] # ABD eq 5 & 9
        
        
        
    val = factor*ijkl # ABD eq 5 & 9
    
    
    return  val

@njit(cache=True,fastmath=True, error_model='numpy', nogil=True)
def Int1d(G,t,ix,jx,kx,lx,xi,xj,xk,xl,alphai,alphaj,alphak,alphal):
    #G = RecurNumba2(G,t,ix,jx,kx,lx,xi,xj,xk,xl,alphai,alphaj,alphak,alphal)
    return Shift(G,ix,jx,kx,lx,xi-xj,xk-xl)

"Form G(n,m)=I(n,0,m,0) intermediate values for a Rys polynomial"
@njit(cache=True,fastmath=True, error_model='numpy', nogil=True)
def Recur(G,t,i,j,k,l,xi,xj,xk,xl,alphai,alphaj,alphak,alphal,A,B,Ap,Bp,ABsrt):
    # print('RecurNumba1', G[0,0])
    # G1 = np.zeros((n1+1,m1+1))
    
    n = i+j
    m = k+l        
    # A = alphai+alphaj 
    # B = alphak+alphal 
    Px = (alphai*xi+alphaj*xj)/A
    Qx = (alphak*xk+alphal*xl)/B

    C,Cp,B0,B1,B1p = RecurFactors(t,A,B,Px,Qx,xi,xk) 
    

    # ABD eq 11.
    G[0,0] = np.pi*np.exp(-Ap*(xi-xj)**2/A - Bp*(xk-xl)**2/B)/ABsrt

    

    if n > 0: G[1,0] = C*G[0,0]   # ABD eq 15
    if m > 0: G[0,1] = Cp*G[0,0]  # ABD eq 16

    for a in range(2,n+1):
        G[a,0] = B1*(a-1)*G[a-2,0] + C*G[a-1,0]
    
    for b in range(2,m+1):
        G[0,b] = B1p*(b-1)*G[0,b-2] + Cp*G[0,b-1]
    

    
    if m==0 or n==0: 
        return G

    for a in range(1,n+1):
        G[a,1] = a*B0*G[a-1,0] + Cp*G[a,0]
        for b in range(2,m+1):
            G[a,b] = B1p*(b-1)*G[a,b-2] + a*B0*G[a-1,b-1] + Cp*G[a,b-1]

    
    
    return G

