"Roots(n,X,roots,weights) - Return roots and weights of nth order Rys quadrature"
@njit(cache=True,fastmath=True, error_model='numpy', nogil=True)
def Roots(n,X,roots,weights):
    
    PIE4 = 7.85398163397448E-01
    if X < 3.0E-7:
        off = n * (n - 1) // 2
        for i in range(n):
            roots[i] = POLY_SMALLX_R0[off+i] + POLY_SMALLX_R1[off+i] * X
            weights[i] = POLY_SMALLX_W0[off+i] + POLY_SMALLX_W1[off+i] * X
        return roots, weights
    elif X > 35+n*5:
        off = n * (n - 1) // 2
        t = np.sqrt(PIE4 / X)
        for i in range(n):
            rt = POLY_LARGEX_RT[off+i]
            roots[i] = rt / (X - rt)
            weights[i] = POLY_LARGEX_WW[off+i] * t
        return roots, weights


    if n == 1:
        return Root1(X,n,roots,weights)
    elif n == 2:
        return Root2(X,n,roots,weights)
    elif n == 3:
        return Root3(X,n,roots,weights)
    elif n == 4:
        return Root4(X,n,roots,weights)
    elif n == 5:
        return Root5(X,n,roots,weights)
    elif n>5 and n<11:
        return Rootn(X,n,roots,weights)

@njit(cache=True,fastmath=True, error_model='numpy')
def nERIRys(t, q1, q2, q3, q4, a12, a34,
             A, B, C, D, P, Q, sRys):
    '''Calculate Rys polynomials for two-electron integrals
    '''  
    # base case
    if q1+q2+q3+q4 == 0:   return 1.0
    
    # cdef double PQ,a1234,C00
    
    #distance between the two gaussian centers   
    PQ = P - Q
    a1234 = a12 + a34

    C00 = P - A - a34 * (PQ) * t / a1234

    if  q1==1 and q2+q3+q4==0: return C00
    
    # cdef double C01, D00, B00

    if q2==1 and q1+q3+q4==0:
        C01 = C00 + (A - B)
        return C01

    D00 = Q - C + a12 * (PQ) * t / a1234
    if  q3==1 and q1+q2+q4==0: return D00


    if  q1+q2+q3==0 and q4==1:
        D01 = D00 + (C - D)
        return D01

    B00 = t / (2 * a1234)    

    if q1==1 and q3==1 and q2+q4 == 0:   return D00 * C00 + B00
    
    # cdef int n, m, i, j
    n , m = q1 + q2 , q3 + q4
 
    if n > 0: sRys[1,0] = C00
    if m > 0: sRys[0,1] = D00


    B10 = 1 /(2 * a12) + -a34 * t/ ((2 * a12) * (a1234))
    B01 = 1 /(2 * a34) +  -a12 * t / ((2 * a34) * (a1234))

    for i in range(1, n+1):
        sRys[i,0] = C00 * sRys[i-1,0] + (i - 1) * B10 * sRys[i-2,0]

    for i in range(1,m+1):
        sRys[0,i] = D00 * sRys[0,i-1] + (i - 1) * B01 * sRys[0,i-2]   
    
    if m * n > 0:
    
        for i in range(1,n+1):
            sRys[i,1] = D00 * sRys[i,0] + i * B00 * sRys[i-1,0]
        for j in range(2,m+1):
            sRys[i,j] = (j-1) * B01 * sRys[i,j-2] + i * B00 * sRys[i-1,j-1] + D00 * sRys[i,j-1]
 
    if q2 + q4 == 0: return sRys[q1,q3]  
    
    # cdef double Rys,Rys0,AB,CD,Poly1

    Rys = 0

    #Angular momentum transfer
    AB,CD = A-B, C-D

    for i in range(q4+1):
        Rys0 = 0
        for j in range(q2+1):
           
            # I(i,j,m,0)<-I(n,0,m,0)
            Poly1 = comb(q2,j) * np.power(AB,q2-j) * sRys[j+q1,i+q3]
            Rys0 += Poly1
            
        Rys0 *= comb(q4, i) * np.power(CD, q4-i)
        Rys += Rys0 # I(i,j,k,l)<-I(i,j,m,0)
        
    return Rys

@njit(cache=True,fastmath=True, error_model='numpy')
def ChebGausInt(eps,M,a12,a34, qx1, qx2, qx3, qx4,
                         qy1, qy2, qy3,  qy4, qz1, qz2, qz3,  qz4, x1,
                         x2,  x3, x4,  y1,  y2,  y3, y4,
                         z1,  z2,  z3, z4,  Px, Py, Pz,
                         Qx, Qy, Qz, T, sRys):
    
    # cdef double c0,s0,c1,s1,q,p,chp,c,s,xp,t1,t2,ang1,ang2,err
    # cdef int j,n,i
    err,n,c0,s0 = 10,3,0.866025403784438646,.5
    c1 = s0
    s1 = c0
    t1,t2 = 0.7628537665044517,0.0160237616047743
    ang1 = (nERIRys(t1,qx1,qx2,qx3,qx4,a12,a34,x1,x2,x3,x4,Px,Qx,sRys)* 
            nERIRys(t1,qy1,qy2,qy3,qy4,a12,a34,y1,y2,y3,y4,Py,Qy,sRys)*
            nERIRys(t1,qz1,qz2,qz3,qz4,a12,a34,z1,z2,z3,z4,Pz,Qz,sRys))
            
    ang2 = (nERIRys(t2,qx1,qx2,qx3,qx4,a12,a34,x1,x2,x3,x4,Px,Qx,sRys)* 
            nERIRys(t2,qy1,qy2,qy3,qy4,a12,a34,y1,y2,y3,y4,Py,Qy,sRys)*
            nERIRys(t2,qz1,qz2,qz3,qz4,a12,a34,z1,z2,z3,z4,Pz,Qz,sRys))
            
    q = 0.28125 * (np.exp(-T*t1) * ang1 + np.exp(-T*t2) * ang2)
    p = (0.5*np.exp(-T*0.25)* nERIRys(0.25,qx1,qx2,qx3,qx4,a12,a34,x1,x2,x3,x4,Px,Qx,sRys)*
         nERIRys(0.25,qy1,qy2,qy3,qy4,a12,a34,y1,y2,y3,y4,Py,Qy,sRys)*
         nERIRys(0.25,qz1,qz2,qz3,qz4,a12,a34,z1,z2,z3,z4,Pz,Qz,sRys))
    chp = q + p
    j = 0
    while err > eps:
        j = 1 - j
        c1 = j * c1 + (1-j) * c0
        s1 = j * s1 + (1-j) * s0
        c0 = j * c0 + (1-j) * np.sqrt(0.5 * (1 + c0))
        s0 *= j + (1-j)/(2 * c0)
        c,s = c0,s0
        
        for i in range(1,n,2):
            xp = 1 + 0.21220659078919378 * s * c * (3 + 2*s*s) - i/n
            if np.ceil(3*(i+j+j)/3.) > (i + j):
               
                t1 = 0.25 * (-xp+1) * (-xp+1)
                t2 = 0.25 * (xp+1) * (xp+1)
               
                ang1 = (nERIRys(t1,qx1,qx2,qx3,qx4,a12,a34,x1,x2,x3,x4,Px,Qx,sRys)*
                        nERIRys(t1,qy1,qy2,qy3,qy4,a12,a34,y1,y2,y3,y4,Py,Qy,sRys)*
                        nERIRys(t1,qz1,qz2,qz3,qz4,a12,a34,z1,z2,z3,z4,Pz,Qz,sRys))
                        
                ang2 = (nERIRys(t2,qx1,qx2,qx3,qx4,a12,a34,x1,x2,x3,x4,Px,Qx,sRys)* 
                        nERIRys(t2,qy1,qy2,qy3,qy4,a12,a34,y1,y2,y3,y4,Py,Qy,sRys)*
                        nERIRys(t2,qz1,qz2,qz3,qz4,a12,a34,z1,z2,z3,z4,Pz,Qz,sRys))
                
                chp += 0.5 * (np.exp(-T*t1) * ang1 + np.exp(-T*t2) * ang2) * s ** 4
                
            xp = s 
            s = s*c1 + c*s1
            c = c*c1 - xp*s1
            
        n *= (1+j)
        p += (1-j)*(chp-q)
        err = 16 * np.abs((1-j)*(q-3*p/2)+j*(chp-2*q))/(3*n)
        q = (1 - j) * q + j * chp
        print(err)
    print('convgd')
    ssss = 1.0
    return 16*q/(3*n) 

